import IncomeSum from "./IncomeSum";
import ExpensesSum from "./ExpensesSum";
import "./Header.css";
import Date from "./Date";

const Header = () => {
  return (
    <div className="header">
      <div className="header__container">
        <p>
          Available budget in <Date />
        </p>
        <h1>+1000.00</h1>
        <IncomeSum />
        <ExpensesSum />
      </div>
    </div>
  );
};

export default Header;
